import React from "react";
import"./style.css";

const ViewMoreButton = (props) => {

    return (
        <button className="btn-view" onClick={() => {props.getMoreBooks(); props.setCurrentIndex(10);}}>View More<div className="btn-view__down-arrow"/></button>
    );
}

export default ViewMoreButton;
